import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
      <nav className="navbar">
        <h1>The Happy Abode</h1>
        <div className="links">
          <link to="/">Home</link>
          <link to="/Create" style={{ 
            color: 'white', 
            backgroundColor: '#8d35f1',
            borderRadius: '8px' 
          }}>New Listing</link>
        </div>
      </nav>
    );
  }
   
  export default Navbar;
